/*global AJAXPOST, FILLIN, HELPTOPICS, TIMEPICKER, CAL, window, URLTOPDF, ADMIN, COMMON, DISPLAYGRID, EMBED, CANVAS, CKEDITOR, CANV2, MAIN, CARDS, PFLOGOS*/
/*jslint node:true, white:true, browser:true, this:true, maxlen: 1000000*/
var INVREPORT = {};
INVREPORT.controlDivId = "divControls";
INVREPORT.displayDivId = "divMain";


INVREPORT.initControls = function () {
    var allLocations = AJAXPOST.callQuery("WMS_GetAllLocations").payload;

    var keys = Object.keys(allLocations.rows);
    var ddl = [{ "text": "--select an option--", "value": "" }];
    keys.forEach(function (item) {
        ddl.push({ "text": allLocations.rows[item], "value": allLocations.rows[item] });
    });

    var formIndex = FILLIN.createForm(INVREPORT.controlDivId, "Inventory Report", "Select a company below to display a report");
    FILLIN.addFormButton(formIndex, "butNelson", "Nelson", null, "INVREPORT.initGrid('Nelson')", null, null, { "class": "butCompany" });
    FILLIN.addFormButton(formIndex, "butSwa", "SWA", null, "INVREPORT.initGrid('SWA')", null, null, { "class": "butCompany" });
    FILLIN.addFormButton(formIndex, "butFerry", "Ferry Cap", null, "INVREPORT.initGrid('Ferry Cap')", null, null, { "class": "butCompany" });
    FILLIN.addFormButton(formIndex, "butSkn", "SKN", null, "INVREPORT.initGrid('SKN')", null, null, {"class" : "butCompany"});
    //FILLIN.addDDL(formIndex, "ddlFrom", "", "From", null, ddl);
    //FILLIN.addDDL(formIndex, "ddlTo", "", "To", null, ddl);
    //FILLIN.addDDL(formIndex, "ddlTo", "", "To", null);
    FILLIN.displayForm(formIndex);
}

INVREPORT.initGrid = function (company) {
    
    //document.getElementById(SDNLORDERS.displayDivId).innerHTML = "<h2>Loading...Please Wait.</h2><div><img src=\"" + SDNLORDERS.waitingAnimation + "\" alt=\"Please Wait\" width=\"64\" height=\"64\" /></div>";
    //window.setTimeout(function(){
    //})
    var isComplete = true;
    var params = [
        company
    ]

    INVREPORT.reportData = AJAXPOST.callQuery("WMS_GetPhysInvReport", params).payload;

    var keys = Object.keys(INVREPORT.reportData.rows);
    keys.forEach(function (item) {
        if (INVREPORT.reportData.rows[item][10] === "No") {
            isComplete = false;
        }
    });
    
    var gridIndex = DISPLAYGRID.addGrid(INVREPORT.displayDivId, "divInvReportGrid", null, null, 20);
    DISPLAYGRID.addColorDefinition(gridIndex, 2, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addColorDefinition(gridIndex, 3, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addColorDefinition(gridIndex, 4, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addColorDefinition(gridIndex, 5, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addColorDefinition(gridIndex, 6, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addColorDefinition(gridIndex, 10, 10, function (val) {
        return val === "No" ? "#ff9999" : "#80ff80"
    })
    DISPLAYGRID.addTitles(gridIndex, company + " Report <input id=\"butExcel\" type=\"button\" value=\"Create Excel\" onclick=\"INVREPORT.createExcel('" + company + " Report');\"></input><input id=\"butCsv\" type=\"button\" value=\"Create CSV\" onclick=\"INVREPORT.createCsv('" + company + " Report');\"></input><div>", (isComplete ? "<span style=\"color:green\">All inventory for " + company + " is complete</span>"  : "<span style=\"color:red\">All inventory must be complete for " + company + " before you can create a report</span>"));

    //<div class=\"divNotCompleteSquare\"></div><div style=\"margin-top: 6px; font-size: 14px; display:inline-block; vertical-align: top;\">Not Complete</div></div></div>
    DISPLAYGRID.ignoreFilterRow(gridIndex);
    DISPLAYGRID.alternateColors(gridIndex);
    DISPLAYGRID.display(gridIndex, INVREPORT.reportData);

    if (isComplete) {
        document.getElementById("butExcel").disabled = false;
        document.getElementById("butCsv").disabled = false;
    }
    else {
        //document.getElementById("butExcel").disabled = true;
        //document.getElementById("butCsv").disabled = true;
    }
}

INVREPORT.createExcel = function (title) {
    var numbercolumns = [];
    for (i = 0; i < INVREPORT.reportData.columns.length; i += 1) {
            numbercolumns.push(i);
    }
    AJAXPOST.protectedFunctions.gridExcel(INVREPORT.reportData.rows, title, INVREPORT.reportData.columns, numbercolumns);
};

INVREPORT.createCsv = function (title) {
    var csvColumns;
    var csvRows = [];
    csvColumns = INVREPORT.reportData.columns.join(',');
    for (var i = 0, l = INVREPORT.reportData.rows.length; i < l; ++i) {
        csvRows.push(INVREPORT.reportData.rows[i].join(','));
    }
    var csvString = (csvColumns + "\r\n") + csvRows.join("\r\n");

    if (window.navigator.msSaveOrOpenBlob) {
        var blob = new Blob([decodeURIComponent(encodeURIComponent(csvString))], {
            type: "text/csv;charset=utf-8;"
        });
        navigator.msSaveBlob(blob, title + ".csv");
    }
    else {
        var a = document.createElement("a");
        a.href = "data:attachment/csv," + encodeURIComponent(csvString);
        a.target = "_blank";
        a.download = "title" + ".csv";

        document.body.appendChild(a);
        a.click();
    }
}

INVREPORT.waitingAnimation = "data:image/gif;base64," + "" + "";